{
  "translationLines": [
    {
      "lineNumber": 205822,
      "originalJapaneseLine": "「お姉ちゃんはちょっとしてる」",
      "translatedEnglishLine": "\"Big sister's a little nervous.\""
    },
    {
      "lineNumber": 205823,
      "originalJapaneseLine": "リセットは小刻みに震えている",
      "translatedEnglishLine": "Reset is trembling slightly."
    },
    {
      "lineNumber": 205824,
      "originalJapaneseLine": "小さな手を見せてきた。",
      "translatedEnglishLine": "She showed her small hand."
    },
    {
      "lineNumber": 205825,
      "originalJapaneseLine": "「えへへ、もしもの時は、",
      "translatedEnglishLine": "\"Ehehe, if something happens,"
    },
    {
      "lineNumber": 205826,
      "originalJapaneseLine": "　お姉ちゃんのこと助けてね？」",
      "translatedEnglishLine": " please help big sister, okay?\""
    },
    {
      "lineNumber": 205827,
      "originalJapaneseLine": "「＜エール＞ちゃんが困ってる時は",
      "translatedEnglishLine": "\"When <Yell>-chan is in trouble"
    },
    {
      "lineNumber": 205828,
      "originalJapaneseLine": "　お姉ちゃんが助けるから」",
      "translatedEnglishLine": " big sister will help you.\""
    },
    {
      "lineNumber": 205829,
      "originalJapaneseLine": "「ふふっ」",
      "translatedEnglishLine": "\"Fufu.\""
    },
    {
      "lineNumber": 205830,
      "originalJapaneseLine": "「おい、＜エール＞。",
      "translatedEnglishLine": "\"Hey, <Yell>."
    },
    {
      "lineNumber": 205831,
      "originalJapaneseLine": "　テメェ、ブルってねぇだろうな？」",
      "translatedEnglishLine": " You ain't trembling, right?\""
    },
    {
      "lineNumber": 205832,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 205833,
      "originalJapaneseLine": "「へっ、そんな可愛いタマでもねーか」",
      "translatedEnglishLine": "\"Hmph, guess you’re not such a scaredy-cat after all.\""
    },
    {
      "lineNumber": 205834,
      "originalJapaneseLine": "「ビビッてたら、",
      "translatedEnglishLine": "\"If you were scared,"
    },
    {
      "lineNumber": 205835,
      "originalJapaneseLine": "　喝入れてやろーかと思ってたんだがな」",
      "translatedEnglishLine": " I was thinking of giving you a kick to snap out of it.\""
    },
    {
      "lineNumber": 205836,
      "originalJapaneseLine": "「準備出来てんなら、行くぞ」",
      "translatedEnglishLine": "\"If you're ready, let's go.\""
    },
    {
      "lineNumber": 205837,
      "originalJapaneseLine": "「楽しー、楽しー、魔王退治の時間だ」",
      "translatedEnglishLine": "\"Fun, fun, it’s time to slay the Demon King!\""
    },
    {
      "lineNumber": 205838,
      "originalJapaneseLine": "「がはははははははははははは！」",
      "translatedEnglishLine": "\"Gahahahahahahahaha!\""
    },
    {
      "lineNumber": 205839,
      "originalJapaneseLine": "ザンスは本当に楽しそうだった。",
      "translatedEnglishLine": "Zansu truly looked delighted."
    },
    {
      "lineNumber": 205840,
      "originalJapaneseLine": "「しゅくん殿。",
      "translatedEnglishLine": "\"Lord Shukun."
    },
    {
      "lineNumber": 205841,
      "originalJapaneseLine": "　何かあったらウズメの後ろに隠れてね。",
      "translatedEnglishLine": " If anything happens, hide behind Uzume."
    },
    {
      "lineNumber": 205842,
      "originalJapaneseLine": "　ウズメ、盾になってでも守るでござるから」",
      "translatedEnglishLine": " Uzume will protect you even if it means becoming a shield.\""
    },
    {
      "lineNumber": 205843,
      "originalJapaneseLine": "「なんたって、",
      "translatedEnglishLine": "\"After all,"
    },
    {
      "lineNumber": 205844,
      "originalJapaneseLine": "　ウズメはしゅくんの忍者でござるからね」",
      "translatedEnglishLine": " Uzume is Shukun's ninja, after all.\""
    },
    {
      "lineNumber": 205845,
      "originalJapaneseLine": "「と言っても……」",
      "translatedEnglishLine": "\"That being said...\""
    },
    {
      "lineNumber": 205846,
      "originalJapaneseLine": "「へへへー、そんな簡単に守らせては",
      "translatedEnglishLine": "\"Hehehe, I don’t think you’ll let me protect you so easily."
    },
    {
      "lineNumber": 205847,
      "originalJapaneseLine": "　くれないって気がしてる」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 205848,
      "originalJapaneseLine": "「だから、一緒に頑張ろうでござる」",
      "translatedEnglishLine": "\"So, let's do our best together.\""
    },
    {
      "lineNumber": 205849,
      "originalJapaneseLine": "決戦前にも関わらず、",
      "translatedEnglishLine": "Despite the final battle ahead,"
    },
    {
      "lineNumber": 205850,
      "originalJapaneseLine": "ウズメは呑気にそう笑っていた。",
      "translatedEnglishLine": " Uzume smiled so carefree."
    },
    {
      "lineNumber": 205851,
      "originalJapaneseLine": "「長かった旅も……",
      "translatedEnglishLine": "\"Our long journey..."
    },
    {
      "lineNumber": 205852,
      "originalJapaneseLine": "　今日で終わりか」",
      "translatedEnglishLine": " ends today, huh.\""
    },
    {
      "lineNumber": 205853,
      "originalJapaneseLine": "「悔いのないよう、終わらせよう」",
      "translatedEnglishLine": "\"Let’s finish it without regrets.\""
    },
    {
      "lineNumber": 205854,
      "originalJapaneseLine": "「まあ、そういう点は、",
      "translatedEnglishLine": "\"Well, in that regard,"
    },
    {
      "lineNumber": 205855,
      "originalJapaneseLine": "　＜エール＞なら心配いらないかな」",
      "translatedEnglishLine": " I guess there’s no need to worry with <Yell>.\""
    },
    {
      "lineNumber": 205856,
      "originalJapaneseLine": "「そろそろ行こうか」",
      "translatedEnglishLine": "\"Shall we head out soon?\""
    },
    {
      "lineNumber": 205857,
      "originalJapaneseLine": "「＜エール＞ちゃん、準備出来た？」",
      "translatedEnglishLine": "\"<Yell>-chan, are you ready?\""
    },
    {
      "lineNumber": 205858,
      "originalJapaneseLine": "「……ん、そっか」",
      "translatedEnglishLine": "\"...Mm, I see.\""
    },
    {
      "lineNumber": 205859,
      "originalJapaneseLine": "「私も万全。",
      "translatedEnglishLine": "\"I'm ready too."
    },
    {
      "lineNumber": 205860,
      "originalJapaneseLine": "　ちゃんと一人で準備したよ？」",
      "translatedEnglishLine": " I properly prepared all by myself, you know?\""
    },
    {
      "lineNumber": 205861,
      "originalJapaneseLine": "「ふふん」",
      "translatedEnglishLine": "\"Fufun.\""
    },
    {
      "lineNumber": 205862,
      "originalJapaneseLine": "何故かそれだけのことで、",
      "translatedEnglishLine": "For some reason, just because of that,"
    },
    {
      "lineNumber": 205863,
      "originalJapaneseLine": "深根はえっへんと胸を張っていた。",
      "translatedEnglishLine": " Fukane puffed out her chest proudly."
    },
    {
      "lineNumber": 205864,
      "originalJapaneseLine": "「さ、行こっか」",
      "translatedEnglishLine": "\"Alright, let’s go.\""
    },
    {
      "lineNumber": 205865,
      "originalJapaneseLine": "「まったく……",
      "translatedEnglishLine": "\"Really...\""
    },
    {
      "lineNumber": 205866,
      "originalJapaneseLine": "　変なことに巻き込まれて",
      "translatedEnglishLine": " Getting involved in weird stuff"
    },
    {
      "lineNumber": 205867,
      "originalJapaneseLine": "　こんなとこまで来るなんてね……」",
      "translatedEnglishLine": " and coming all the way here...\""
    },
    {
      "lineNumber": 205868,
      "originalJapaneseLine": "「あたしにはやることが沢山あるのに……」",
      "translatedEnglishLine": "\"I have so much to do...\""
    },
    {
      "lineNumber": 205869,
      "originalJapaneseLine": "「＜エール＞、",
      "translatedEnglishLine": "\"<Yell>,"
    },
    {
      "lineNumber": 205870,
      "originalJapaneseLine": "　ちっちゃっと終わらせるわよ」",
      "translatedEnglishLine": " let’s wrap this up quick.\""
    },
    {
      "lineNumber": 205871,
      "originalJapaneseLine": "「……ん。",
      "translatedEnglishLine": "\"...Mm."
    },
    {
      "lineNumber": 205872,
      "originalJapaneseLine": "　分かってるなら、いいのよ」",
      "translatedEnglishLine": " If you understand, that’s fine.\""
    },
    {
      "lineNumber": 205873,
      "originalJapaneseLine": "ミックスは少し満足げに、",
      "translatedEnglishLine": "Mix looked a little satisfied,"
    },
    {
      "lineNumber": 205874,
      "originalJapaneseLine": "あなたの目には映った。",
      "translatedEnglishLine": " as seen through your eyes."
    },
    {
      "lineNumber": 205875,
      "originalJapaneseLine": "「＜エール＞ちゃん……」",
      "translatedEnglishLine": "\"<Yell>-chan...\""
    },
    {
      "lineNumber": 205876,
      "originalJapaneseLine": "「えっと、その……」",
      "translatedEnglishLine": "\"Um, well...\""
    },
    {
      "lineNumber": 205877,
      "originalJapaneseLine": "「が、頑張ろうね！」",
      "translatedEnglishLine": "\"L-let’s do our best!\""
    },
    {
      "lineNumber": 205878,
      "originalJapaneseLine": "「えへへ……",
      "translatedEnglishLine": "\"Ehehe..."
    },
    {
      "lineNumber": 205879,
      "originalJapaneseLine": "　そ、それだけ、言いたかったの……」",
      "translatedEnglishLine": " I just wanted to say that, that’s all...\""
    },
    {
      "lineNumber": 205880,
      "originalJapaneseLine": "杖をギュッと握って、",
      "translatedEnglishLine": "Gripping her staff tightly,"
    },
    {
      "lineNumber": 205881,
      "originalJapaneseLine": "スシヌは頼りないいつもの笑顔を浮かべていた。",
      "translatedEnglishLine": " Sushinu wore her usual unreliable smile."
    }
  ]
}

